import React from 'react';
import { BrowserRouter as Router, Route, NavLink, Switch } from 'react-router-dom';
import './App.css'; // Import the CSS file for styling

const HomePage = () => {
  return (
    <Router>
      <div className="homepage">
        <header>
          <h1>Welcome to Arthmate</h1>
        </header>
        <nav className="tabs">
          <NavLink exact to="/" activeClassName="active-tab" className="tab-link">
            Introduction
          </NavLink>
          <NavLink to="/team" activeClassName="active-tab" className="tab-link">
            Team
          </NavLink>
          <NavLink to="/about" activeClassName="active-tab" className="tab-link">
            What We Do
          </NavLink>
        </nav>
        <div className="content">
          <Switch>
            <Route exact path="/">
              <Introduction />
            </Route>
            <Route path="/team">
              <Team />
            </Route>
            <Route path="/about">
              <About />
            </Route>
          </Switch>
        </div>
      </div>
    </Router>
  );
};

const Introduction = () => {
  return (
    <div>
      <h2>Introduction</h2>
      <p>
        Insert your introductory content here from the official website of Arthmate.
      </p>
    </div>
  );
};

const Team = () => {
  return (
    <div>
      <h2>Team</h2>
      <p>
        Insert information about your team members here from the official website of Arthmate.
      </p>
    </div>
  );
};

const About = () => {
  return (
    <div>
      <h2>What We Do</h2>
      <p>
        Insert information about what your company does here from the official website of Arthmate.
      </p>
    </div>
  );
};

export default HomePage;
